sys_variable_value.value:
(function execute(inputs, outputs) {
  try{
  var vcnUtil = new OracleVirtualCloudNetworkUtils();
  vcnUtil.validateInputVariables(inputs, outputs);
  vcnUtil.validateMandatoryVariables(inputs,["vcnId","routeRules"]);
    if(!inputs.compartmentId){
		inputs.compartmentId = inputs.tenancyId;
    }

    vcnUtil.validateMandatoryVariables(inputs,["compartmentId"]);
  var payload = vcnUtil.createPayload(inputs,["vcnId","displayName","compartmentId","routeRules"]); 
  vcnUtil.trimValues(inputs.freeformTags);
  var tags = vcnUtil.createTagsPayload(inputs.freeformTags);  
  if(Object.keys(tags).length){
        payload.freeformTags = tags;
  }
  outputs.payload = JSON.stringify(payload);
  }
  catch(ex){
    throw new Error("Mandatory Fields Should be provided");
  }
})(inputs, outputs);

